
If Exists ( Select * From Sysobjects (NoLock) Where Name = 'BI_RPT__InformacionVales_Auxiliar' and xType = 'U' ) 
   Drop Table BI_RPT__InformacionVales_Auxiliar 
Go--#SQL 

Create Table BI_RPT__InformacionVales_Auxiliar
(
	IdEmpresa varchar(3) Not Null Default '', 
	IdEstado varchar(2) Not Null Default '', 
	IdFarmacia varchar(4) Not Null Default '', 
	FolioVale varchar(20) Not Null Default '', 
	FechaEmisionVale varchar(10) Not Null Default '', 
	FolioCanjeVale varchar(20) Not Null Default '', 

	FechaSurtidoVale varchar(10) Not Null Default '', 
	Año int Not Null Default 0, 
	Mes int Not Null Default 0, 

	ClaveSSA varchar(20) Not Null Default '', 
	DescripcionSSA varchar(max) Not Null Default '', 
	Cantidad int Not Null Default 0		
)
Go--#SQL    


 Go--#SQL 


Update A Set FechaEmisionVale = convert(varchar(10), V.FechaRegistro, 120)  
From BI_RPT__InformacionVales_Auxiliar A (NoLock) 
Inner Join Vales_EmisionEnc V (NoLock) 
	On ( A.IdEmpresa = V.IdEmpresa and A.IdEstado = V.IdEstado and A.IdFarmacia = V.IdFarmacia and cast(A.FolioVale as int) = cast(V.FolioVale as int) ) 
Go--#SQL 

Update A Set ClaveSSA = C.ClaveSSA, DescripcionSSA = C.DescripcionClave 
From BI_RPT__InformacionVales_Auxiliar A (NoLock) 
Inner Join vw_ClavesSSA___PRCS C (NoLock) On ( A.ClaveSSA = C.ClaveSSA or C.ClaveSSA like '%' + A.ClaveSSA + '%' ) 
-- Inner Join vw_ClavesSSA___PRCS C (NoLock) On ( A.ClaveSSA = C.ClaveSSA ) 
Go--#SQL 



